import React from 'react';
import ingredients from './BurgerIngredients.module.css';
import {Tab, CurrencyIcon} from '@ya.praktikum/react-developer-burger-ui-components';
import {data} from '../../utils/data'
import {Counter} from '@ya.praktikum/react-developer-burger-ui-components'



function BurgerIngredients () {

        const [current, setCurrent] = React.useState('one');

        return(
            <section className={ingredients.main}>
                <div className={` mt-10 mb-5 ${ingredients.container}`}>
                    <h1 className={`text text_type_main-medium ${ingredients.text}`}> Собери бургер </h1>
                    </div>
                    <div className={`mb-10 ${ingredients.tabs}`} style={{ display: 'flex' }}>
                        <Tab value="one" active={current === 'one'} onClick={setCurrent} className={ingredients.text}>
                            Булки
                            </Tab>
                            <Tab value="one" active={current === 'two'} onClick={setCurrent}>
                                Соусы
                                </Tab>
                                <Tab value="one" active={current === 'three'} onClick={setCurrent}>
                                    Начинки
                                    </Tab>
                                    </div>
                                    <p className={`mb-6 text text_type_main-default ${ingredients.text}`}> Булки </p>
                                    <div className={` pl-4 pr-4 mb-10 ${ingredients.puns}`}>

                        <div className={ingredients.scroul}>
                        <div className={ingredients.container}> 


                        {data.map(ingr =>  {
                            if (ingr.type === 'bun') {
                                return( 
                            <div key={ingr.id} className={`mr-4 ${ingredients.column}`}>
                                <div className={ingredients.icon}>
                                    <Counter count={1} size="default" extraClass="m-1"/>
                                </div>
                                <img className={`ml-4 ${ingredients.img}`} src={ingr.image}/>
                                <div className={`mt-1 mb-1 ${ingredients.price}`}>
                                    <h1 className={ingredients.ball}> {ingr.price}</h1>
                                <CurrencyIcon type="primary" className={ingredients.priceIcon}/>
                                </div>
                                <div className={ingredients.title}>
                                    <span className={`${ingredients.name} `}> {ingr.name} </span>
                                </div>
                            </div>)
                           } }

                    )}
                        </div>



                </div>
                <p className={`mb-6 text text_type_main-default ${ingredients.text}`}> Соусы </p>
                <div className={` pl-4 pr-4 mb-10 ${ingredients.souses}`}>
                    <div className={`mr-4 ${ingredients.column}`}>
                         </div>
                         {data.map(ingr =>  {
                            if (ingr.type === 'sauce') {
                                return( 
                            <div key={ingr.id} className={`mr-4 ${ingredients.column}`}>
                                <div className={ingredients.icon}>
                                    <Counter count={1} size="default" extraClass="m-1"/>
                                </div>
                                <img className={`ml-4 ${ingredients.img}`} src={ingr.image}/>
                                <div className={`mt-1 mb-1 ${ingredients.price}`}>
                                    <h1 className={ingredients.ball}> {ingr.price}</h1>
                                <CurrencyIcon type="primary" className={ingredients.priceIcon}/>
                                </div>
                                <div className={ingredients.title}>
                                    <span className={`${ingredients.name} `}> {ingr.name} </span>
                                </div>
                            </div>)
                           } }

                    )}

                </div>
                </div>

            </section>
        )
    }


export default BurgerIngredients;
